import React, { lazy, Suspense } from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from '../pages/Home';
import AllMovie from '../components/AllMovie/AllMovie';

const MovieDetail = lazy(() => import('../pages/detail/MovieDetail'));

const Content = () => {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Suspense fallback={<h2>Loading</h2>}>
        <Route path="/:category/:id" element={<MovieDetail />} />
      </Suspense>
      <Route path="/:category" element={<AllMovie />} />
      <Route path="/:category/search/:kw" element={<AllMovie />} />
    </Routes>
  );
};

export default Content;
